        display: flex;
        align-items: center;
        justify-content: center;
        color: $white;

        width: 100vh;

        position: absolute;
        left: 80px;
        top: 0;


        transform: rotate(90deg);
        transform-origin: left bottom;

        opacity: 0;
        animation: fadeInLeft-social 1s;
        animation-delay: 2.5s;
        animation-fill-mode: forwards;


